sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
if(inputs.variant=="VRN006" ){//|| inputs.variant=="VRN003" || inputs.variant=="VRN004"
    var pt=(parseInt(inputs.pt) + parseInt(inputs.age))+"";
    outputs.pt= pt.split(".")[0];
}
else{
    outputs.pt=inputs.pt;
}
})(inputs, outputs);

